(77,3,'A社は鉄鋼業市場の2/3を専有しており、A社の1日の売上げの3/4が75,000円であった。業界全体の1日の売上げ額はいくらか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',7),(78,3,'ある報告書をタイプするため、タイピストに支払う金が2,000円ある。A嬢が42ページ、B嬢が28ページタイプすると、Ａ嬢はいくら受取るか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',8),(79,3,'印刷装置を使って1日に176,400行印刷した。印刷装置をその日7時間稼動させたとすると1分間に何行印刷したことになるか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',9),(80,3,'ある販売会社は１日の総収入のうち20,000円を宣伝費に使い、残りの半分を販売員の手数料として支払ったところ6,000円残った。1日の総収入はいくらだったか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',10),(81,3,'30分に80枚のカードを穿孔することができるキーパンチオペレーターは、7時間半に何枚のカードを穿孔することができるか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',11),(82,3,'みかん4個とりんご5個の値段があわせて160円であった。りんご1個の値段が20円とするとみかん1個の値段はいくらか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',12),(83,3,'キーパンチオペレーターが月曜日に一束のカードを穿孔した。火曜日には月曜日の3倍、水曜日には4,000枚穿孔した。3日のうちにあわせて16,000枚穿孔した。火曜日には何枚穿孔したことになるか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',13),(84,3,'計算機用テープライブラリーにテープ用の棚が2個あり、各々に40本のテープが入っている。或るとき30本のテープが使われた。棚に残ったテープを分数で表すと次のうちどれか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',14),(85,3,'2台の計算機があって夫々1日に48,000枚の証書を作り出した。一つの計算機は1時間に9,600枚、もう一つの計算機は1時間に7,800枚の証書を作った。前者が仕事を完了したとき後者はあと何枚証書を作らなければならないか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',15),(86,3,'ある会社は毎月700万円で計算機を借りている。5年経過してから会計係が計算してみると、もし計算機を購入していたら、毎月維持費を100万円支払ったとしても2,000万円節約できたであろうということが分かった。計算機の購入価格はいくらか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',16),(87,3,'計算機用テープが3本ある。1本あたりの長さは平均すると6,800メートルである。但し、6,400メートルより短いテープは1本もない。可能性として一番長いテープは何メートルにまでなりうるか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',17),(88,3,'1人のセールスマンが2週間に1度の割合で注文を獲得すれば、彼は会社の年間記録を破ることになる。しかしながら、52週間のうち28週間過ぎた時点で予定よりも注文が遅れている。記録を破るためには、以後どんな割合で注文をとればよいか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',18),(89,3,'ある日、銀行は客から戻ってきた16,000枚の小切手を持っていた。800枚を検査したところ100枚に誤りがあった。そのため誤りの小切手はすぐには処理できなかった。この割合でいくと、その日すぐに処理できた小切手は何枚か。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',19),(90,3,'ある会社で男子従業員の20%、女子社員の40%が会社のピクニックに参加した。全従業員の35%が男子であれば、全従業員の何%がピクニックに行ったことになるか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',20),(91,3,'ノート製造業者がAノートの価格を1冊当り30円から28円に下げ、Bノートの価格を1冊当り24円から23円に下げた。ある事務所はこれまで毎月ノートに1,440円使い、その3/4がAノートに費やされてきた。新しい価格では毎月いくら節約できるか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',21),(92,3,'12人で構成されるプログラミング・ティームがある。そのうち1/3が女子、2/3が男子である。女子の比率を20%にするには男子を何人雇えばいいか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',22),(93,3,'寸法が48×30×52メートルの機械がある。もし機械が各辺比例して大きくなり、寸法の和が156メートルになったとしたら、最も短い辺は何メートルになるか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',23),(94,3,'ある会社で応接室に敷くカーペットが37.8平方メートル必要になり、無駄をみこんで必要量より20%多く注文することに決定した。カーペットは平方メートル以下の単位で発注することはできない。1平方メートル当り9千円とすると全体でいくらになるか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',24),(95,3,'フットボール大会のプログラムを作るのに１部70円かかる。もし広告料が1,500,000円得られるとしたら、800,000円の利益をあげるために１部50円のプログラムを何部売らなければならないか。',NULL,'2025-09-25 00:56:29','2025-09-25 00:56:29',25);
