INSERT INTO `practice_questions` (`id`, `part`, `text`, `explanation`, `image`, `created_at`, `updated_at`, `number`) VALUES (1,1,'a b a b a b a b\r\n','この問題では配列が ab ab ab ab という順になっています。\r\nしたがって次に来る文字は a となります。\r\n',NULL,NULL,NULL,1),(2,1,'a a b b c c d d\r\n','この問題では配列が aa bb cc dd という順になっています。\r\nしたがって次に来る文字は e となります。\r\n',NULL,NULL,NULL,2),(3,1,'c a d a e a f a\r\n','この問題では配列が ca da ea fa という順になっています。\r\nしたがって次に来る文字は g となります。\r\n',NULL,NULL,NULL,3),(4,1,'a x b y a x b y a x b\r\n','この問題では配列が axby axby axb という順になっています。\r\nしたがって次に来る文字は y となります。\r\n',NULL,NULL,NULL,4),(5,2,'','例題ではグレーの四角が時計の針が動く方向へ順次動いています。すなわち、右上、右下、左下、左上という順序です。したがって、次はまた右上となります。\r\n','pq1.gif',NULL,NULL,1),(6,2,'','左側の一連の図では線が1本ずつふえ、かつ次第に長くなっています。右側の五つの図の中から次にくるべき図では、線が5本で4番目の図よりも1本多く、5本目の線がやや長くなっているものとなります。\r\n','pq2.gif',NULL,NULL,2),(7,3,'3個10円のリンゴは80円で何個買えるか。\r\n','80 ÷ 10 × 3 = 24。よって24個です。\r\n',NULL,NULL,NULL,1),(8,3,'太郎は4週間に2,800円貯めた。毎週平均いくらずつ貯めたことになるか。\r\n','2,800 ÷ 4 = 700。よって700円です。\r\n',NULL,NULL,NULL,2);
